import React from 'react'
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation,Autoplay } from 'swiper/modules';

const ListImgSlider = [
    {img : "https://scr.vn/wp-content/uploads/2020/07/T%E1%BA%A3i-h%C3%ACnh-%E1%BA%A3nh-si%C3%AAu-xe-HD-c%E1%BB%B1c-%C4%91%E1%BA%B9p-v%E1%BB%81-m%C3%A1y.jpg"},
    {img : "https://scr.vn/wp-content/uploads/2020/07/%E1%BA%A2nh-si%C3%AAu-xe-Lamborghini-Full-HD.jpg"},
    {img : "https://scr.vn/wp-content/uploads/2020/07/%E1%BA%A2nh-si%C3%AAu-xe-%C4%91%E1%BA%B9p-ch%E1%BA%A5t-l%C6%B0%E1%BB%A3ng-cao.jpg"},
    {img : "https://scr.vn/wp-content/uploads/2020/07/H%C3%ACnh-Si%C3%AAu-xe-Roll-Royce-4k-scaled.jpg"},
  ]
export default function HomePage() {
  return (
    <div style={{background:"#ccc"}}>
      <section className='pb-4 bg-white'>
        <div className="container-fluid">
            <div className="row">
                <div className="col-8">
                    <Swiper
                        slidesPerView={1}
                        spaceBetween={30}
                        loop={true}
                        pagination={{
                            clickable: true,
                        }}
                        autoplay={{
                        delay: 3000,
                        disableOnInteraction: false,
                        }}
                        navigation={true}
                        modules={[Navigation,Autoplay]}
                        className="mySwiper"
                    >
                        {
                            ListImgSlider.map((e,index)=>(
                                <SwiperSlide key={index}>
                                    <img style={{borderRadius:"20px"}} width="100%" height="auto" src={e.img} alt="sliderbar" />
                                </SwiperSlide>
                            ))
                        }
                    </Swiper>
                </div>
                <div className="col-4">
                    <div className="">
                        <div className="">
                            <img style={{borderRadius:"20px"}} width="100%" height="auto" src="https://vanhoadoisong.vn/wp-content/uploads/2022/05/100-hinh-nen-anh-sieu-xe-dep-full-hd-cho-may-tinh-dien-thoai-01.jpg" alt="sliderbar" />
                        </div>
                        <div className="pt-3">
                            <img style={{borderRadius:"20px"}} width="100%" height="auto" src="https://media-cdn-v2.laodong.vn/Storage/NewsPortal/2019/6/10/738354/595097.jpg" alt="sliderbar" />
                        </div>
                    </div>
                </div>
            </div>
        </div>
      </section>
    </div>
  )
}
